def fixName(name):
    invalidChar = ['[',']','(',')','{','}','+','=','&','^','%','$','#','@','!','~','`',';','\'',' ']
    rx = '[' + re.escape(''.join(invalidChar)) + ']'
    return re.sub(rx, '_', name)

def rSuffix(string):
    if string.endswith('.ogg'):
        return string[:-len('.ogg')]

